// --- inish3_epsp_f.cfg ---

ATTRIBUTES(COMMON)
{
    // INPUT ATTRIBUTES
    inish3_epsp_f_count                = SIZE("inish3_epsp_f_count");
    INISH3_EPSP_F_SUBOBJ               = ARRAY[inish3_epsp_f_count](SUBOBJECT, "List of keys/items");

    // HM INTERNAL
    KEYWORD_STR                        = VALUE(STRING, "List of keys/items");
}

SKEYWORDS_IDENTIFIER(COMMON)
{
    //INPUT ATTRIBUTES
    inish3_epsp_f_count                = -1;
    INISH3_EPSP_F_SUBOBJ               = -1;

    //HM INTERNAL
    KEYWORD_STR                        = 9000;
}


GUI(COMMON)
{
    ASSIGN(KEYWORD_STR, "/INISH3/EPSP_F/");

    SUBOBJECT(INISH3_EPSP_F_SUBOBJ)     { SUBTYPES = ( /SUBOBJECT/INISH3_EPSP_F_SUBOBJ ) ; }
}

// File format
FORMAT(radioss51)
{
    HEADER("/INISH3/EPSP_F/");
    SUBOBJECTS(INISH3_EPSP_F_SUBOBJ, /SUBOBJECT/INISH3_EPSP_F_SUBOBJ);
}